 import React from "react";
 import product_cart from "../data/product_data";
import './mainproduct.css';

const Mainproduct = () => {


const listItem=product_cart.map((item)=>
<div className="cards">
<div className="card">
<div className="imgandtitle">
<img src={item.thumb} alt="Logo" className="img" />

<div className="title">
<h1>{item.name}</h1>
</div>
</div>

<div className="description">
<p>{item.description}</p>
</div>
<p className="price">{item.real_price}</p>

</div>
</div>

);

return (
  <div>
 <section className="section">
<div className="container" >
 {listItem}
</div>
</section> </div> 
);


}


 export default  Mainproduct;
